import { all, fork } from 'redux-saga/effects';
import { addItem, deleteItem, list, getI } from './list';

export default function* rootSaga() {
    yield all(
        [
            fork(list),
            fork(deleteItem),
            fork(addItem),
            fork(getItem)
        ]
    );
}
